import React from "react";
import myTools from "./DeveloperTools";
import { Link } from "react-router-dom";

function Tools() {

    return (
        <div>
            <h1>These are my Developer Tools!</h1>
            <ul>
                {myTools.map((tool, index) => (
                <li key={index}>{tool.name}: {tool.experience}</li>
                ))}
            </ul>
            <Link to="/skills">
                <button>
                    Languages
                </button>
            </Link>
            <Link to="/frameworks">
                <button>
                    Frameworks/Technologies
                </button>
            </Link>
        </div>
    )
}

export default Tools;
